    TO OPERATING EXPENDITURES WHEN THE RECEIPT WAS ACTUALLY 'LIST RENTAL INCOME' AND
    SHOULD HAVE BEEN CLASSIFIED AS AN OTHER RECEIPT.  ACCORDING, WE HAVE MADE THAT
    CHANGE ON THIS AMENDED REPORT.   PLEASE NOTE THAT WE HAVE PROVIDED ADDITIONAL
    INFORMATION FOR MANY OF THE DONORS THAT WERE ORIGINALLY MISSING INFORMATION.  IN
    ADDITION, OUR BEST EFFORTS PROCEDURES FOR OBTAINING THE REQUIRED INFORMATION ARE
    AS FOLLOWS: (1) OUR SOLICITATIONS FOR CONTRIBUTIONS CONTAIN A CLEAR AND CONSPICUOUS
    REQUEST FOR THE REQUIRED INFORMATION AND THE SOLICITATIONS INFORM THE CONTRIBUTOR
    THAT THIS INFORMATION IS REQUIRED TO BE REPORTED UNDER FEDERAL LAW, (2) A FOLLOW
    UP LETTER IS SENT WITHIN 30 DAYS OF RECEIPT IF THE REQUIRED INFORMATION HAS NOT
    BEEN OBTAINED, AND (3) THE COMMITTEE WILL EITHER FILE AMENDED REPORTS, OR WILL
    REPORT MEMO ENTRIES ON THE NEXT REPORT IF IT RECEIVES THE INFORMATION AFTER THE
    FILING OF PREVIOUS REPORT.  LASTLY, IN REGARDS TO YOUR INQUIRY ABOUT LIMITED ADMINISTRATIVE
    EXPENSES, PLEASE NOTE THAT AMERICA'S FOUNDATION HAS PAID AND REPORTED AMOUNTS
    FOR 'MANAGEMENT FEES'  AND 'ACCOUTING FEES' TO THE FIRMS THAT PROVIDED SUCH ADMINISTRATIVE
    SERVICES TO THE COMMITTEE (SUCH AS CAPITOL RESOURCE GROUP INC, VIRGINIA DAVIS
